import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import ExpertCardPage from './components/ExpertCardPage';
import DoctorCardPage from './components/DoctorCardPage';
import DspCardPage from './components/DspCardPage';
import WorkplacePage from './components/WorkplacePage';
import VisitsPage from './components/VisitsPage'; // Added VisitsPage import
import Navbar from './components/Navbar';
import './App.css';

// Wrapper components to include Navbar with proper routing context
const DashboardPage = () => (
  <>
    <Navbar />
    <Dashboard />
  </>
);

const ExpertPage = () => (
  <>
    <Navbar />
    <ExpertCardPage />
  </>
);

const DoctorPage = () => (
  <>
    <Navbar />
    <DoctorCardPage />
  </>
);

const DspPage = () => (
  <>
    <Navbar />
    <DspCardPage />
  </>
);

const WorkplacePageWrapper = () => (
  <>
    <Navbar />
    <WorkplacePage />
  </>
);

// Added VisitsPage wrapper
const VisitsPageWrapper = () => (
  <>
    <Navbar />
    <VisitsPage />
  </>
);

function App() {
  return (
    <Router>
      <div className="app">
        <Routes>
          <Route path="/" element={<DashboardPage />} />
          <Route path="/experts" element={<ExpertPage />} />
          <Route path="/doctors" element={<DoctorPage />} />
          <Route path="/dsps" element={<DspPage />} />
          <Route path="/workplaces" element={<WorkplacePageWrapper />} />
          <Route path="/visits" element={<VisitsPageWrapper />} /> // Added visits route
        </Routes>
      </div>
    </Router>
  );
}

export default App;
